import data from "./props.json"

function Athlete() {
    // console.log(data.monday)
    return (
        <div className="Athlete">
            {
                data.map((data, i) => (
                    <div className="individual-athlete" key={i}>
                        <select>
                            <label>Pick a sport</label>

                        </select>
                        <h1>{data.name}</h1>
                        <h2>{data.date}</h2>
                        <h3>{data.sport}</h3>
                        <p>{data.data.stress}</p>
                    </div>
                ))
            }
            {/* <h1>{data.name}</h1>
            <h2>{data.date}</h2>
            <h2>{data.weekday.monday.fatigue}</h2>
            <h3>{data.averageScore}</h3> */}
        </div>
    )
}

